    private static readonly string BASE_64_PHOTO = "data:image/png;base64,";

    public static async Task SeedUsers(this PlayersDbContext context)
    {
        Player player = new()
        {
            GeneralProfile = new PlayerGeneralProfile
            {
                FirstName = "Andrii",
                LastName = "Kryvoruk",
                City = "Kyiv",
                Biography = "asdasdasdasdasdasd",
                Birthday = new DateTime(1992, 12, 4),
                FreePlay = true
            },
            FootballProfile = new PlayerFootballProfile
            {
                Position = FootballPosition.Forward,
                AdditionalPosition = FootballPosition.Midfielder,
                GameStyle = GameStyle.Attacking,
                Height = 180,
                Number = 4,
                PhysicalCondition = 1,
                Skill = 3,
                WeakFoot = 1,
                Weight = 65,
                WorkingFoot = WorkingFoot.Right
            },
            Availability = new PlayerAvailability
            {
                Days = new List<PlayerAvailableDay> {
                    new PlayerAvailableDay { Day = DayOfWeek.Wednesday},
                    new PlayerAvailableDay { Day = DayOfWeek.Saturday},
                    new PlayerAvailableDay { Day = DayOfWeek.Sunday}
                },
                From = TimeSpan.FromHours(18),
                To = TimeSpan.FromHours(21)
            },
            Points = new PlayerStatPoints
            {
                Available = 3,
                Used = 0
            },
            User = new User
            {
                UserId = Guid.Parse("{836A7FB9-73FE-4107-91F2-4D916158E242}")
            }
        };

        player.Tags.Add(new PlayerTag { Value = "Tag 1" });
        player.Tags.Add(new PlayerTag { Value = "Tag 2" });

        STATS.ForEach(player.Stats.Add);

        byte[] source = Convert.FromBase64String(BASE_64_PHOTO[(BASE_64_PHOTO.IndexOf(",") + 1)..]);
        player.Photo = new PlayerPhoto
        {
            Extension = PhotoExtension.Png,
            Name = "Photo",
            Source = source,
            Size = source.Length
        };

        await context.Players.AddRangeAsync(new List<Player> { player });
        await context.SaveChangesAsync();
    }
